INSERT INTO `v1_69e7abc347096b413136c705c63db1e6c6cb17eb219be670fff329e37ee54ce8` VALUES (2, 1, 3, "---", 0, "", 6000, "アサヒ", "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 1);
INSERT INTO `v1_69e7abc347096b413136c705c63db1e6c6cb17eb219be670fff329e37ee54ce8` VALUES (3, 3, 0, "アドレナリン", 3, "ホームランを連発すると、連発数に応じてパワーアップする", 16000, "部員3", "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 1);
INSERT INTO `v1_69e7abc347096b413136c705c63db1e6c6cb17eb219be670fff329e37ee54ce8` VALUES (4, 2, 2, "ラッキー", 2, "幸運のハプニングを呼び込む", 30000, "{0}", "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 1);
INSERT INTO `v1_69e7abc347096b413136c705c63db1e6c6cb17eb219be670fff329e37ee54ce8` VALUES (5, 0, 1, "", 1, "", 50000, "選手名鑑 おまけページ", "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", 0);
